Here is an example end user API for 3D camera animation in TypeScript:

```typescript
// import the necessary modules
import * as THREE from 'three';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls.js';
import { Vector3 } from 'three';

// define a camera class
class Camera {
    private target: Vector3;
    private position: Vector3;
    private up: Vector3;
    private controls: OrbitControls;

    constructor(target: Vector3, position: Vector3, up: Vector3) {
        this.target = target;
        this.position = position;
        this.up = up;
        this.controls = new OrbitControls(this.camera, renderer.domElement);
        this.controls.target = target;
        this.controls.update();
    }

    // getters and setters for camera properties
    get target(): Vector3 { return this.target; }
    set target(value: Vector3) { this.target = value; }
    get position(): Vector3 { return this.position; }
    set position(value: Vector3) { this.position = value; }
    get up(): Vector3 { return this.up; }
    set up(value: Vector3) { this.up = value; }
}

// define a scene class
class Scene {
    private camera: Camera;
    private renderer: THREE.WebGLRenderer;
    private scene: THREE.Scene;
    private controls: OrbitControls;
    private clock: THREE.Clock;

    constructor(camera: Camera, renderer: THREE.WebGLRenderer, scene: THREE.Scene) {
        this.camera = camera;
        this.renderer = renderer;
        this.scene = scene;
        this.controls = new OrbitControls(this.camera, renderer.domElement);
        this.controls.target = camera.target;
        this.controls.update();
        this.clock = new THREE.Clock();
    }

    // update method to animate scene
    update() {
        const delta = this.clock.getDelta();
        this.controls.update(delta);
        renderer.render(this.scene, this.camera);
    }

    // add objects to scene
    add(object: any) {
        this.scene.add(object);
    }

    // remove objects from scene
    remove(object: any) {
        this.scene.remove(object);
    }
}

// define a renderer class
class Renderer {
    private scene: THREE.Scene;
    private camera: Camera;
    private clock: THREE.Clock;
    private renderer: THREE.WebGLRenderer;

    constructor(scene: THREE.Scene, camera: Camera) {
        this.scene = scene;
        this.camera = camera;
        this.clock = new THREE.Clock();
        this.renderer = new THREE.WebGLRenderer({ antialias: true });
        this.renderer.setSize(window.innerWidth, window.innerHeight);
        document.body.appendChild(this.renderer.domElement);
    }

    // render method to update scene
    render() {
        this.renderer.render(this.scene, this.camera);
        requestAnimationFrame(() => this.render());
    }
}

// define a main class to initialize the scene and camera
class Main {
    private scene: Scene;
    private renderer: Renderer;
    private camera: Camera;

    constructor() {
        // create a camera and scene
        const target = new Vector3(0, 0, 0);
        const position = new Vector3(0, 0, 10);
        const up = new Vector3(0, 1, 0);
        const camera = new Camera(target, position, up);
        const scene = new THREE.Scene();

        // create a renderer
        const renderer = new Renderer(scene, camera);

        // add objects to the scene
        const cube = new THREE.Mesh(
            new THREE.BoxGeometry(1, 1, 1),
            new THREE.MeshBasicMaterial({ color: 0xff0000 })
        );
        cube.position.x = 2;
        scene.add(cube);

        // start the rendering loop
        renderer.render();
    }
}

// create a new main class to initialize the scene and camera
const main = new Main();
```

This example API includes a `Camera` class that defines the camera's target, position, and up vector, as well as an `OrbitControls` object to allow the user to control the camera's position and rotation. It also includes a `Scene` class that manages the scene's objects, a `Renderer` class that handles rendering the scene, and a `Main` class that initializes the scene and camera and starts the rendering loop.

